import React from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  Button, 
  Grid, 
  Card, 
  CardContent,
  useTheme,
  IconButton 
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import { motion } from 'framer-motion'; // Add this import

function Home() {
  const theme = useTheme();
  const navigate = useNavigate();

  const scrollToFeatures = () => {
    const featuresSection = document.getElementById('features');
    featuresSection.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <Box sx={{ minHeight: '100vh', background: '#000000' }}>
      {/* Hero Section */}
      <Box
        sx={{
          position: 'relative',
          minHeight: '100vh',
          display: 'flex',
          alignItems: 'center',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: '-20%',
            right: '-10%',
            width: '60%',
            height: '60%',
            background: 'radial-gradient(circle, rgba(220, 20, 60, 0.15) 0%, transparent 70%)',
            filter: 'blur(80px)',
            zIndex: 1,
          }
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 2 }}>
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            <Grid container spacing={4} alignItems="center">
              <Grid item xs={12} md={7}>
                <Box sx={{ 
                  textAlign: { xs: 'center', md: 'left' },
                  mt: { xs: -8, md: -4 }
                }}>
                  <Typography
                    variant="h1"
                    sx={{
                      fontSize: { xs: '2.5rem', md: '4rem', lg: '5rem' },
                      mb: 2,
                      background: 'linear-gradient(45deg, #FFFFFF 30%, #DC143C 90%)',
                      WebkitBackgroundClip: 'text',
                      WebkitTextFillColor: 'transparent',
                      fontWeight: 700,
                      letterSpacing: '-0.02em',
                    }}
                  >
                    Master Your Time
                  </Typography>
                  <Typography
                    variant="h2"
                    sx={{
                      fontSize: { xs: '1.25rem', md: '1.5rem' },
                      mb: 4,
                      color: 'rgba(255, 255, 255, 0.7)',
                      fontWeight: 400,
                      letterSpacing: '0.02em',
                      lineHeight: 1.5,
                    }}
                  >
                    AI-Powered Study Schedule Optimization
                  </Typography>
                  <Box sx={{ 
                    display: 'flex', 
                    gap: 2,
                    justifyContent: { xs: 'center', md: 'flex-start' }
                  }}>
                    <Button
                      variant="contained"
                      size="large"
                      onClick={() => navigate('/register')}
                      sx={{
                        py: 2,
                        px: 4,
                        fontSize: '1rem',
                        textTransform: 'none',
                        borderRadius: '12px',
                        background: 'linear-gradient(45deg, #DC143C, #FF4D6A)',
                        boxShadow: '0 4px 15px rgba(220, 20, 60, 0.3)',
                        '&:hover': {
                          transform: 'translateY(-2px)',
                          boxShadow: '0 6px 20px rgba(220, 20, 60, 0.4)',
                        },
                      }}
                    >
                      Get Started
                    </Button>
                    <Button
                      variant="outlined"
                      size="large"
                      onClick={() => navigate('/login')}
                      sx={{
                        py: 2,
                        px: 4,
                        fontSize: '1rem',
                        textTransform: 'none',
                        borderRadius: '12px',
                        borderColor: 'rgba(255, 255, 255, 0.1)',
                        color: 'white',
                        '&:hover': {
                          borderColor: '#DC143C',
                          backgroundColor: 'rgba(220, 20, 60, 0.1)',
                        },
                      }}
                    >
                      Login
                    </Button>
                  </Box>
                </Box>
              </Grid>
            </Grid>
          </motion.div>
        </Container>

        <Box
          onClick={scrollToFeatures}
          sx={{
            position: 'absolute',
            bottom: 40,
            left: '50%',
            transform: 'translateX(-50%)',
            zIndex: 2,
            cursor: 'pointer',
            opacity: 0.7,
            transition: 'opacity 0.2s',
            '&:hover': { opacity: 1 },
          }}
        >
          <motion.div
            animate={{ y: [0, 10, 0] }}
            transition={{ duration: 2, repeat: Infinity }}
          >
            <KeyboardArrowDownIcon sx={{ color: '#DC143C', fontSize: 40 }} />
          </motion.div>
        </Box>
      </Box>

      {/* Features Section */}
      <Box 
        id="features" 
        sx={{ 
          py: { xs: 10, md: 15 },
          background: 'linear-gradient(180deg, #000000 0%, #0A0A0F 100%)',
        }}
      >
        <Container maxWidth="lg">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
          >
            <Typography
              variant="h3"
              align="center"
              sx={{
                mb: { xs: 8, md: 10 },
                fontSize: { xs: '2rem', md: '2.5rem' },
                fontWeight: 600,
                color: '#fff',
                letterSpacing: '-0.02em',
              }}
            >
              Why Choose Tempo?
            </Typography>
            <Grid container spacing={4}>
              {[
                {
                  icon: <AccessTimeIcon sx={{ fontSize: 40, color: '#DC143C' }} />,
                  title: "Smart Scheduling",
                  description: "AI-powered scheduling that adapts to your study habits and preferences."
                },
                {
                  icon: <AutoGraphIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
                  title: "Performance Analytics",
                  description: "Track your progress and optimize your study efficiency with real-time insights."
                },
                {
                  icon: <CalendarMonthIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
                  title: "Seamless Planning",
                  description: "Effortlessly manage your academic schedule with our intuitive interface."
                }
              ].map((feature, index) => (
                <Grid item xs={12} md={4} key={index}>
                  <motion.div
                    initial={{ opacity: 0, y: 20 }}
                    whileInView={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.5, delay: index * 0.2 }}
                    viewport={{ once: true }}
                  >
                    <Card
                      sx={{
                        height: '100%',
                        background: 'rgba(255, 255, 255, 0.02)',
                        backdropFilter: 'blur(20px)',
                        borderRadius: '24px',
                        border: '1px solid rgba(255, 255, 255, 0.05)',
                        transition: 'transform 0.3s ease',
                        '&:hover': {
                          transform: 'translateY(-8px)',
                        },
                      }}
                    >
                      <CardContent sx={{ p: 4, textAlign: 'center' }}>
                        <Box
                          sx={{
                            mb: 3,
                            display: 'inline-flex',
                            p: 2,
                            borderRadius: '16px',
                            background: 'rgba(220, 20, 60, 0.1)',
                          }}
                        >
                          {feature.icon}
                        </Box>
                        <Typography
                          variant="h5"
                          sx={{
                            mb: 2,
                            fontWeight: 600,
                            color: '#fff',
                          }}
                        >
                          {feature.title}
                        </Typography>
                        <Typography
                          variant="body1"
                          sx={{
                            color: 'rgba(255, 255, 255, 0.7)',
                            lineHeight: 1.7,
                          }}
                        >
                          {feature.description}
                        </Typography>
                      </CardContent>
                    </Card>
                  </motion.div>
                </Grid>
              ))}
            </Grid>
          </motion.div>
        </Container>
      </Box>

      {/* CTA Section */}
      <Box
        sx={{
          py: { xs: 10, md: 15 },
          background: '#000000',
          position: 'relative',
          '&::before': {
